import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import state from './Readux/State'
import {addPost} from "./Readux/State";
let renderIndex = () =>{
    ReactDOM.render(
        <App state={state} addPost={addPost} />,
        document.getElementById('root')
    );
}


